import React from 'react';
import Head from 'next/head';
import AppLayout from "../components/AppLayout";

const Signup = () => {
    return (
        <div>
            <Head>
                <title>Sign up| NodeBird</title>
            </Head>
            <AppLayout>
                my profile
            </AppLayout>        
        </div>
    );
};

export default Signup;
